#import "TMPasteboardHelper.h"
#import "TMConstants.h"
#import "Base64.h"

@implementation TMPasteboardHelper

+ (id)sharedManager {
    static TMPasteboardHelper *sharedMyManager = nil;
    static dispatch_once_t onceToken;
    dispatch_once(&onceToken, ^{
        sharedMyManager = [[self alloc] init];
    });
    return sharedMyManager;
}

- (id)init {
    if (self = [super init]) {

    }
    return self;
}

- (NSString*)fetchingPDFDocumentFromPasteBoard
{
    UIPasteboard * pasteboard=[UIPasteboard generalPasteboard];
    NSData * pdfData = [pasteboard dataForPasteboardType:kPDFPasteBoadKey];
    NSString *base64 = [pdfData base64EncodedStringWithOptions:0];
    return base64;
}

- (void)testPasteBoardSetUp
{
    UIPasteboard * pasteboard=[UIPasteboard generalPasteboard];
    [pasteboard setData:[self pdfDocument] forPasteboardType:kPDFPasteBoadKey];
}

- (NSData *)pdfDocument
{
    NSString *base64Str =
    @"";
    return [NSData dataWithBase64EncodedString:base64Str];
}

@end
